import Modal from "./Modal";

const ModalHolder = (props) => {
    var modalChecker= props.modalName;
    const [modalchecker, setmodalchecker] = useState('');
    
    setmodalchecker(modalChecker);
    
    console.log(modalchecker)
    const closeModal=()=>{
        setmodalchecker('');
    }
    
    return (
        <div style={{ color: "white" }}>
            {modalchecker === "projects" &&
                <Modal onClose={closeModal} >
                  
                </Modal>
            }
            {modalchecker === "skills" &&
                <Modal onClose={closeModal} >
                  
                </Modal>
            }
            {modalchecker === "experience" &&
                <Modal onClose={closeModal} >
                  
                </Modal>
            }
            {modalchecker === "achievements" &&
                <Modal onClose={closeModal} >
                  
                </Modal>
            }
            </div>
    );
}

            export default ModalHolder;
